// modules/module.ts

export default async (inlineOptions, nuxt) => {
  console.log(inlineOptions.foo) // \`bar\`
  console.log(nuxt.options.dev) // true or false

  nuxt.hook('ready', async nuxt => {
    console.log('Nuxt is ready')
  })
}
